		out.availableAggregations.get("lsoa").add("avg");
		out.availableAggregations.get("lsoa").add("median");
		
		out.availableAggregations.put("msoa", new HashSet<String>());
		out.availableAggregations.get("msoa").add("avg");
		out.availableAggregations.get("msoa").add("median");
		
		out.availableAggregations.put("borough", new HashSet<String>());
		out.availableAggregations.get("borough").add("avg");
		out.availableAggregations.get("borough").add("median");
		
