	public List<Correlation> getCorrelatedDataSets(String dataSetId, String correlationType, int maxNum) throws APIException {
	List<Correlation> out=new ArrayList<Correlation>();
		for(int i=0;i<maxNum;i++){	
			Correlation dataSet=new Correlation();
		dataSet.ds1=dataSetId;
		dataSet.ds2="i";
		dataSet.type="pearson";
		dataSet.value=Math.random();
		out.add(dataSet);
	}
	
		return out;
	}

	public Object getRelatedDataSets(String dataSetId, int maxNum) throws APIException {
		DataSet[] out=new DataSet[maxNum];
		for(int i=0;i<maxNum;i++){	
		DataSet dataSet=new DataSet();
		dataSet.dataSourceId="test";
		dataSet.initialAreaId=Integer.toString(i);
		dataSet.initialAggregation="id";
		dataSet.name="test dataset"+i;
		out[i]=dataSet;
	}
	
		return out;
	}

